import React, {  useEffect, useState } from 'react';
import { Alert, Box, Button, Container, Grid2 as Grid, TextField, Typography } from '@mui/material';
import { HttpStatus, post } from '../../utils/api/Api';
import { API_CONFIG } from '../../api-config';
import { BaseResponse } from '../../models/BaseResponse';
import { useNavigate } from 'react-router';
import {FeatureToggle, Off, On} from "../../component/FeatureToggle/FeatureToggle";
import { MyFeatures } from '../../utils/MyFeatures';

export type BookPayload = {
    name?: string;
    author?: string;
    price?: number;
}

export type BookResponse = {
    id?: string
    name?: string;
    author?: string;
    price?: number;
}



const BookCreate: React.FC = () => {
    const [book, setBook] =  useState<BookPayload>({});
    const [bookError, setBookError] = useState("")
    const [authorError, setAuthorError] = useState("")
    const [priceError, setPriceError] = useState("")
    const [isButtonDisabled, setIsButtonDisabled] = useState(true)
    const [showBookResponse, setShowBookResponse] = useState<BaseResponse<BookResponse>>()
    const navigate = useNavigate()

    useEffect(()=> {
        const isTouch = book.name != undefined && book.author != undefined
        const isNoError = bookError.length === 0 && authorError.length === 0 && priceError.length === 0
        setIsButtonDisabled(!(isTouch && isNoError))
    },[book, bookError, authorError, priceError])

    const validateBookName = (bookName: string) => {
        const bookNameLength = bookName.length
        setBookError(bookNameLength <= 47 ? "" : "Book name lenght should less than 47")
    }

    const validateAuthor = (author: string) => {
        const authorLength = author.length
        setAuthorError(authorLength <= 15 ? "" : "Author lenght should less than 15")
    }

    const validatePrice = (price: number) => {
        setPriceError( (price >= 0 && price <= 100000) ? "" : "Price should between 0-100,000")
    }

    const handleOnValueChange = (e:  React.ChangeEvent<HTMLInputElement>) =>{
        const key = e.target.name
        let value = e.target.value

        if(key === 'name')  {validateBookName(value)}
        if(key === 'author')  {validateAuthor(value)}
        if(key === 'price') {
            value= value.replace(",",".")
            validatePrice(e.target.valueAsNumber)
        }     

        setBook((prev) => ( { ...prev, [e.target.name] : value }))
    }

    const handleSummitForm = async () =>{
        try{
            const response: BaseResponse<BookResponse> = await post<BookPayload, BaseResponse<BookResponse>>(API_CONFIG.book.url, {name: book.name?.trim(), author: book.author?.trim(), price: book.price},[HttpStatus.CREATED, HttpStatus.BAD_REQUEST])
            setShowBookResponse(response)    
            if(response.status === HttpStatus.CREATED){
                setTimeout(() => navigate("/"), 1000)   
            }
        }catch(e : unknown){
            const err = e as Error
            setShowBookResponse({status: 400, errorMessage: err.message, data:{}})    
        }
    }


    return (
        <FeatureToggle name={MyFeatures.ADD_BOOK}>
        <On>
            <Container>
                {showBookResponse?.status  && <Alert severity={showBookResponse?.status === 201? "success" : "error"} >{showBookResponse?.errorMessage ?? "Book saved successfully"}</Alert>}
                <Grid container spacing={2}>
                    <Grid container display="flex" flexDirection="column" alignItems="flex-start" size={6} spacing={2} width="100%">
                        <Typography variant='h3'>Create new book</Typography>
                        <TextField data-testid="bookName" name="name" label="Book name" fullWidth required slotProps={{htmlInput : {'data-testid':"bookNameInput"}}} value={book?.name} onChange={handleOnValueChange} helperText={bookError} error={bookError !== ""}  />
                        <TextField data-testid="author" name="author" label="Author"fullWidth required slotProps={{ htmlInput: {'data-testid':"authorInput"}}} value={book?.author} onChange={handleOnValueChange} helperText={authorError} error={authorError !== ""}/>
                        <TextField data-testid="price" name="price" label="Price" type='number' fullWidth required slotProps={{ htmlInput: {'data-testid':"priceInput"}}} value={book?.price} onChange={handleOnValueChange} helperText={priceError} error={priceError !== ""}/>
                        <Box display="flex" justifyContent="flex-end" width="100%" >
                            <Button variant='contained' data-testid="createButton" onClick={handleSummitForm} disabled={isButtonDisabled}>Save</Button>
                        </Box>
                    </Grid>
                </Grid>
            </Container>
      </On>
      <Off>
        <></>
      </Off>
      </FeatureToggle>
    )
}

export default BookCreate;
